import React, { Component } from 'react'

class Form extends Component {
    constructor(props) {
        super(props)

        this.state = {
            username: ''
        }
    }


    handlerUsername = (event) => {

        this.setState({
            username: event.target.value
        })
    }

    render() {
        return (



            <div>

                <div>
                    <h1>Form Component</h1>
                    <label>Username</label>
                    <input type='value' value={this.state.username} onChange={this.handlerUsername}></input>
                </div>

                <div>
                    <label>TextArea</label>
                </div>

            </div>
        )
    }
}

export default Form
